import { About } from './About';
import  '../styles/App.css';
import { NavBar } from './NavBar';
import Navbar from 'react-bootstrap/Navbar';
import { Route, Switch } from 'react-router-dom';

function App() {

  return (
    <>
      <Switch>                
        <Route path='/panda' component={Panda}/>  
        <Route path='/gorilla' component={Gorilla}/>               
        <Route path='/rhino' component={Rhino}/> 
        <Route path='/seaTurtle' component={SeaTurtle}/>  
        <Route path='/' component={Home}/>            
      </Switch>


      <div className="App">
        <Navbar collapseOnSelect expand="sm" bg="light" data-bs-theme="light">
          <NavBar />
        </Navbar>

        <body>
          <About />
        </body>
      </div>
    </>

  );
}

export default App;
